<script>
(function() {
	// Non ES-syntax, so we support older browsers as well.
	var frames = document.querySelectorAll('img.frame'), nrFrames = frames.length;

	if (nrFrames < 2) { return; }

	var playBtn = document.querySelector('#playBtn');
	var loop = true, autoPlay = true;
	var curFrame = 0, duration;

	playBtn.onclick = play;

	function advanceFrame(reset) {
		frames[curFrame].style.visibility = 'hidden';
		curFrame = reset ? 0 : curFrame + 1;
		duration = +frames[curFrame].getAttribute('data-duration');
		frames[curFrame].style.visibility = 'visible';

		setTimeout(function() {
			if (curFrame < nrFrames - 1) {
				advanceFrame();
				return;
			}

			// Last frame shown
			if (loop) {
				advanceFrame(true);
				return;
			}

			// No loop, show play button to restart animation:
			playBtn.style.display = 'block';
			frames[curFrame].style.visibility = 'hidden';
			curFrame = 0;
			frames[curFrame].style.visibility = 'visible';
		}, duration);
	}

	function play() {
		playBtn.style.display = 'none';
		duration = +frames[curFrame].getAttribute('data-duration');
		setTimeout(advanceFrame, duration);
	}

	if (autoPlay) {
		play();
	}
	else {
		playBtn.style.display = 'block';
	}
})();
</script>
